import React from "react";
import { useParams, useLocation, useHistory, useEffect} from "react-router-dom";

const User = () =>{
    const { fname, lname } = useParams();
    const location = useLocation();
    const backLink = useHistory();

    useEffect(()=>{
        alert("Get ur location");
    });
    return(
        <>
        <div className="box_center">
        <h1>Hi I am User : {fname} {lname} </h1> 

        <li>My Link Path : {location.pathname} </li>
        {location.pathname === `/user/Pooja/Raval` ? (
            <button onClick={()=>{ backLink.goBack();}}>Back</button>
            ) : null } 

        
        </div>
        </>
    );
}
export default User;
